def getPasserRating(filename: str) -> dict[str, float]:
    return (lambda player_list: dict(player_list) if len(player_list) == len(set(player_list)) else exec('raise KeyError("Duplicates exist in the list")'))(list(map(lambda line: (lambda player_info: (player_info[0], round((sum(list(map(lambda var: 0 if var < 0 else 2.375 if var > 2.375 else var, [((int(player_info[2]) / int(player_info[1])) - 0.3) * 5, ((int(player_info[3]) / int(player_info[1])) - 3) * 0.25, (int(player_info[4]) / int(player_info[1])) * 20, 2.375 - ((int(player_info[5]) / int(player_info[1])) * 25)]))) / 6) * 100, 1)))(line.split(",")), list(filter(lambda line: False if line.startswith("#") else (True if len(line.split(",")) == 6 else exec('raise ValueError()')), list(map(lambda line: line.replace("\n", ""), open(filename).readlines())))))))
